} fn step(start: (usize, usize), pad: &[[char; 7]; 7], c: char) -> (usize, usize) { let mut pos = start; match c { 'U' => pos.0 = pos.0 - 1, 'D' => pos.0 = pos.0 + 1, 'L' => pos.1 = pos.1 - 1, 'R' => pos.1 = pos.1 + 1, _ => pos = pos, } if pad[pos.0][pos.1] != EMPTY { return pos; } start
