use std::fs;
use std::collections::HashMap; type Grid<T> = Vec<Vec<T>>; /** Read the input file and return the matrix and empty visited map. */
fn read_file(filepath: &str) -> (Grid<char>, Grid<bool>){ let contents = fs::read_to_string(filepath); let mut matrix: Grid<char> = vec![]; let mut visited: Grid<bool> = vec![]; let binding = contents.expect("REASON"); let lines = binding.split('\n'); for line in lines{ let mut matrix_line: Vec<char> = vec!(); let mut visited_line: Vec<bool> = vec!(); for c in line.chars(){ matrix_line.push(c); visited_line.push(false); } matrix.push(matrix_line); visited.push(visited_line); } return (matrix, visited);
} /** Get the key to the hash function. */
fn get_key(position: (usize, usize), movement: (i32, i32)) -> String{ let mut key = String::from(""); key += &position.0.to_string(); key.push(':'); key += &position.1.to_string(); key.push('|'); key += &movement.0.to_string(); key.push(':'); key += &movement.1.to_string(); return key;
} /** Move one tile in a matrix. Also check and if it was used do not go there again. */
